import React from "react";
// import { Link } from "react-router-dom";
import { useFormik } from "formik";
import { signUpSchema } from "../Schemas/Schemas";


const initialValues = {
    name:"",
    password:"",

};

const Login =()=>{
    const {values, errors, touched, handleBlur, handleChange, handleSubmit} = useFormik
    ({initialValues:initialValues,
        validationSchema: signUpSchema,
    // onSubmit : (values)=>{
    //     console.log(values);
    // },
});
    return(
        <>
         <div className="body">
             <form onSubmit={handleSubmit}>
                 <div className="input-block">
                     <label htmlFor="name" className="input-label">Name :-</label>
                     <input type="name" 
                     autoComplete="off" 
                     name="name"  id="name" 
                     placeholder="firstName " 
                     value={values.name}
                     onChange={handleChange}
                     onBlur={handleBlur}
                     /><br/>
                     {errors.name && touched.name?(<span className="form-error">{errors.name}</span>) : null}
                 </div>
                 <br/>
                 <br/>
                 <div className="input-block">
                     <label htmlFor="password" className="input-label">password :-</label>
                     <input type="password"
                      autoComplete="off"
                      name="password"  
                      id="password"
                      placeholder="Password "
                      value={values.password}
                      onChange={handleChange}
                      onBlur={handleBlur}
                    /><br/>
                      {errors.password && touched.password?(<span className="form-error">{errors.password}</span>) : null}
                 </div>
                 <Link to=""></Link><button className="button" type="submit">Login </button>

             </form>
             </div>
        </>
    );
}
export default Login;
